function Shops() {
  return (
    <div><h1>Shops</h1>
     <p>Shop bisuness as been a good bussiness along the lake region and every where country wide </p>
      <p>If you feel like buying something dont stress you self buying things in other places when coming to Luanda Kotieno</p>
      <p>there are several shops and clothe stores selling commodities at the normal retail prices</p>
     <p> There is market day every tuesday from 8:00 am to 2:00 pm where you can get things at abit lower prices 
      and you can get commodities that  are not availlable  in the shops 
     </p>
     <p>Below are photos of shops in the centre</p>
